var jq2_1_3 = $.noConflict(true);
(function($){

  $(document).ready(function(){

    var regPleaseWait = $('.registration-please-wait');
    var regControls = $('.registration-page');
    var $rootDom = $('#registration-option-buttons');
    var rootURL = $rootDom.attr('data-rootURL');

    function attachHashWatcher(){
      function triggerHash(){
        var $trigger = $(window.location.hash);
        if($trigger.hasClass('active') || $trigger.lengt === 0 ) return;
        else{
          $trigger.click();
        }
      }
      triggerHash();
      $(window).on('hashchange',triggerHash);
    }

    function attachAutoStateCheck() {
      stateCheck = setTimeout(function(){
          $.get(rootURL + '/registrationStatus/check')
              .done(function (data, status, xhr) {
                  if (xhr.status === 200) {
                      window.location.href = rootURL + '?valid-license';
                  } else{
                      regPleaseWait.addClass('hidden');
                      regControls.removeClass('hidden');
                      attachAutoStateCheck();
                  }
              })
              .error(function (data) {
                  regPleaseWait.addClass('hidden');
                  regControls.removeClass('hidden');
                  attachAutoStateCheck();
              })
      },5000);
    }
    function attachClientValidation($form){
      var $inputs = $form.find('.form-group input, .form-group checkbox, .form-group radio, .form-group textarea, .form-group select');
      $inputs.on('change',function(a,b,c){
        $(this).closest('.form-group').tooltip('destroy').removeClass('has-error');
      });
    }

    function attachFormPosts($popOver){
      attachClientValidation($popOver);
      attachClosePopOvers($popOver);
      $popOver
      .off('click','.btn-primary')
      .off('click','.btn-default')
      .on('click','.btn-step', function(e){
        e.preventDefault();
        var $button = $(this).button('loading');
        var $form = $button.closest('form');
        $form.find('.step').hide();
        $form.find('.step[data-step="'+$button.attr('href')+'"]').show();
        $button.button('reset');
      })
      .on('click','.btn-primary',function(e,b,c){
         e.preventDefault();
         var $button = $(this).button('loading');
         var $form = $button.closest('form');
         var formResults = $form.serializeArray();

         clearInterval(stateCheck);


         $.post($form.attr("action"),formResults)
           .done(function(data,status){
             respondToFormPost(data,status,e);
           })
           .error(function(data,status){
             respondToFormError(data,status,e);
             attachAutoStateCheck();
           })
           .always(function(data,status){
             $button.button('reset');
           });
       });
    }
    function respondToFormError(data,status,e){
      var $form = $(e.target).closest('form');
      var isError = false;
      var errorObj = $.extend({},data.responseJSON);
      var errorList = [];

      var resetForState = function(){
        $form.find('div.step').hide();
        $form.find('div.step.default').show();
        $form.find('div.step.errorStep').remove();
      };

      if(!data.responseJSON){
        alert('Ooops. Something went wrong...');
        console.log(data.responseText);
        data.responseJSON = {};
        isError = true;
      }

      $form.find('.form-group *[name]:visible').each(function(){
        var $this = $(this);
        if(isError || (this.name && data.responseJSON[this.name])){
          delete errorObj[this.name];
          $this.closest('.form-group')
            .addClass('has-error')
            .tooltip({
              placement:'left',
              title:data.responseJSON[this.name]
            });
        }
      });
      $.each(errorObj,function(k,v){errorList.push({k:k,v:v})});
      if(errorList.length > 0) resetForState();
      $.each(errorList,function(){
        $form.prepend(['<div class="row step errorStep"><div class="alert alert-danger" role="alert">',this.v,'</div></div>'].join(''));
      });


    }
    function respondToFormPost(data,status,e){
      window.location.href = rootURL;
    }

    function hidePopOvers(e){
      e = e || {};
      var $target = $(e.target);
      var $thisPopForm = $target.closest('form.registrar');
      var $thisButton = $target.closest('.btn.pop');
      //If the popovers are closing because of the close button, identify button trigger and deactivate it...
      if($target.closest('.close').length === 1){
        $target = $($thisPopForm.attr('data-trigger'))
        $($thisPopForm.attr('data-trigger')).removeClass('active');
      }
      if($target.closest('.popover').length > 0 ||  $target.closest('.hidden-hover-box').length > 0)
        return true;
      if(($thisButton.length === 0 || $thisButton.hasClass('active') )&& $target.closest('.hidden-hover-box').length === 0)
        window.location.hash = '';
      $rootDom.find('.btn.pop').not($thisButton)
        .popover('hide')
        .blur().removeClass('active').removeClass('focus').removeClass('superShow').find('input').removeAttr('checked');

    }
    function attachClosePopOvers($popOver){
      $popOver.find('a.close').off().on('click',hidePopOvers);
    }

    function attachPopOvers(){
      $('body')
        .click(hidePopOvers)
        .addClass('license-registration-page')
        .append('<div id="hover-space" class="bootstrap3" />');

      $rootDom.find('.btn.pop')
        .click(function(e){
          e.preventDefault();
          var $this = $(this).addClass('superShow');
          if($this.hasClass('active'))
            setTimeout(function(){
              $this.blur().removeClass('active').removeClass('focus').find('input').removeAttr('checked');
              },100);
          else
            $this.find('input').attr('checked',true);

          window.location.hash = $this.attr('href');
        }).popover({
          content:function(a,b,c){
            var $newId = $(this).next();
            $rootDom.find('.btn.pop').not(this).popover('hide');
            return $($newId).html();
          },
          placement:function(context, source){
            function placeHover(){
              var $source = $(source)
              var position = $source.offset();
              var topMargin = 120+position.top;
              var leftMargin = 40+position.left;
              var $context = $(context);
              setTimeout(function(){
                $context.css({'top':topMargin + 'px','left':leftMargin + 'px'  });
                if($(window).width() < $context.offset().left + $context.width()){
                  $context.css({'left':'auto', 'right':0});
                }
                attachFormPosts($context);
              },1);
            }

            placeHover();
            $(window)
              .off('resize')
              .on('resize',placeHover);

          },
          container:'body #hover-space',
          html:true
        });
    }

    function confirmUninstall(){
      $rootDom.find('#default-btn-actions a').each(function(){
        var $this = $(this);
        if ($($this.attr('href')).length === 0)
          $this.remove();
      });
    }
    confirmUninstall();
    attachPopOvers();
    attachHashWatcher();
    attachAutoStateCheck();
  });
})(jq2_1_3);
